import React from "react";

function Connect(){
    return (
        <div className="bg-[#393053]">
            <div>
                <h1>Get In Touch</h1>
                <p>Hey! I am glad that you took out your precious time to check out my portfolio. If you have any questions,
                want to discuss a project, or just want to say hi, feel free to reach out to me.
                      You can connect directly with me
                      I'd love to hear from you!
                </p>
            </div>

        </div>
    );
}

export default Connect;
